import React,{useState,useEffect} from "react";
import Axios from '../../node_modules/axios';


function Finish(){
  let marks = []

  useEffect(() => {
    let currtest = localStorage.getItem("test");
    marks = JSON.parse(currtest);
    console.log(marks)
  },[])

  return (
    <>
       <div class="container">
        <div class="row">
            <h1>My Interview Portal</h1>
            <hr/>
            <div class="col-md-12">
                <div class="panel panel-default">
                    <div class="panel-heading">AngularJS Test - Result</div>
                    <div class="panel-body">
                        <center>
                            <h2 class="">Total no of Questions: 10</h2>
                            <h3 class="text-success">Correct Answers: 6
                            <span class="text-danger">Wrong Answers: 4</span></h3>
                        </center>
                    </div>
                </div>
            </div>
        </div>
    </div>
    </>
  );
}

export default Finish;
